  ctx.fillStyle = '#0a0a1e';
  ctx.fillRect(0, 0, canvas.width, canvas.height);

  // Get current quantum state
  const status = $quantumMemory.status;
  const tensorData = status?.tensor_network;

  if (tensorData) {
    // Update phase
    phase += 0.01;

