    64→interface WebSocketStore {
    65→  connected: boolean;
    66→  status: QuantumMemoryStatus | null;
    67→  error: string | null;
    68→}
    69→
    70→interface RawMessage {
    71→  timestamp: string;
    72→  direction: 'sent' | 'received';
    73→  data: string;
    74→}
    75→
    76→function createWebSocketStore() {
    77→  const { subscribe, set, update } = writable<WebSocketStore>({
    78→    connected: false,
    79→    status: null,
    80→    error: null
    81→  });
    82→
    83→  let ws: WebSocket | null = null;
    84→  let reconnectTimeout: ReturnType<typeof setTimeout> | null = null;
    85→  let rawMessageSubscribers: Array<(msg: RawMessage) => void> = [];
    86→
    87→  function connect() {
    88→    try {
    89→      console.log('[WebSocket] Attempting to connect to ws://localhost:8768');
    90→      ws = new WebSocket('ws://localhost:8768');
    91→
    92→      ws.onopen = () => {
    93→        update(state => ({ ...state, connected: true, error: null }));
    94→        console.log('[WebSocket] ✅ Connected to quantum memory system');
    95→      };
    96→
    97→      ws.onmessage = (event) => {
    98→        // Broadcast raw message to subscribers
    99→        const rawMsg: RawMessage = {
   100→          timestamp: new Date().toISOString(),
   101→          direction: 'received',
   102→          data: event.data
   103→        };
   104→        rawMessageSubscribers.forEach(subscriber => subscriber(rawMsg));
   105→        
   106→        try {
   107→          const data = JSON.parse(event.data);
   108→          console.log('[WebSocket] 📨 Received data:', {
   109→            messages: data.memory_stats?.total_messages,
   110→            moments: data.memory_stats?.emotional_moments,
   111→            time: data.memory_stats?.time_together,
   112→            emotion: data.emotional_dynamics?.primary_emotion
   113→          });
   114→          update(state => ({ ...state, status: data }));
   115→        } catch (e) {
   116→          console.error('[WebSocket] Failed to parse message:', e);
   117→        }
   118→      };
   119→
   120→      ws.onerror = (error) => {
   121→        console.error('[WebSocket] ❌ Error:', error);
   122→        update(state => ({ ...state, error: 'Connection error' }));
   123→      };
   124→
   125→      ws.onclose = (event) => {
   126→        update(state => ({ ...state, connected: false }));
   127→        console.log(`[WebSocket] Disconnected - Code: ${event.code}, Reason: ${event.reason}`);
   128→        console.log('[WebSocket] Will reconnect in 5s...');
   129→        
   130→        // Reconnect after 5 seconds
   131→        reconnectTimeout = setTimeout(connect, 5000);
   132→      };
   133→    } catch (error) {
   134→      console.error('Failed to create WebSocket:', error);
   135→      update(state => ({ ...state, error: 'Failed to connect' }));
   136→    }
   137→  }
   138→
   139→  function disconnect() {
   140→    if (reconnectTimeout) {
   141→      clearTimeout(reconnectTimeout);
   142→      reconnectTimeout = null;
   143→    }
   144→    if (ws) {
   145→      ws.close();
   146→      ws = null;
   147→    }
   148→  }
   149→
   150→  function sendMessage(message: any) {
   151→    if (ws && ws.readyState === WebSocket.OPEN) {
   152→      const msgStr = JSON.stringify(message);
   153→      ws.send(msgStr);
   154→      
   155→      // Broadcast sent message to subscribers
   156→      const rawMsg: RawMessage = {
   157→        timestamp: new Date().toISOString(),
   158→        direction: 'sent',
   159→        data: msgStr
   160→      };
   161→      rawMessageSubscribers.forEach(subscriber => subscriber(rawMsg));
   162→    }
   163→  }
   164→  
   165→  function subscribeToRawMessages(callback: (msg: RawMessage) => void) {
   166→    rawMessageSubscribers.push(callback);
   167→    
   168→    // Return unsubscribe function
   169→    return () => {
   170→      rawMessageSubscribers = rawMessageSubscribers.filter(sub => sub !== callback);
   171→    };
   172→  }
   173→
   174→  return {
   175→    subscribe,
   176→    connect,
   177→    disconnect,
   178→    sendMessage,
   179→    subscribeToRawMessages
   180→  };
   181→}
   182→
   183→export const quantumMemory = createWebSocketStore();

